import React, { useState } from 'react';
import './span.css'

const MovingText = () => {
  const [isClicked, setIsClicked] = useState(false);

  const handleClick = () => {
    setIsClicked(true);
  };

  return (
    <div>
      <input type="text" onClick={handleClick} />
      <label>Input</label>
      <span className={isClicked ? 'move' : ''}>Texto en movimiento</span>
    </div>
  );
};

export default MovingText;
